                    <Routes>
                        <Route path="/home" element={<Home/>}/>
                        <Route path="/" element={<Home/>}/>
                        <Route path="/shop" element={<Shop/>}/>
                        <Route path="/contact" element={<ContactUs/>}/>
                    </Routes>
                </UserContext.Provider>
            </BrowserRouter> 
        </div>
    )
}

export default App;
